import { Grid, makeStyles, Typography } from '@material-ui/core';
import React from 'react';
import AppContent from '../Content/AppContent';
import AppbarGeneric from '../Generics/AppbarGeneric';

const useStyles = makeStyles((theme) => ({
    content: {
        marginRight: 100,
        justifyContent:"center",
        alignItems:"center"
    }
}));

const ProfilePage: React.FC = () => {

    const styles = useStyles();

    return(
        <React.Fragment>
        <AppbarGeneric />
            <AppContent>
            <Grid container spacing={2} className={styles.content}>
                <Grid item style={{backgroundColor:"red"}} md={10} xl={10} lg={10} xs={10} sm={10} spacing={13}>
                    d
                </Grid>
                <Grid item style={{backgroundColor:"red"}} md={10} xl={10} lg={10} xs={10} sm={10} spacing={3}>
                    d
                </Grid>
            </Grid>
        </AppContent>
        </React.Fragment>
    );
}

export default ProfilePage;
